import React from "react";
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";

function Header() {
  return (
    <Router>
    <div className="nav">
      <div className="nav-item">
        <span className="nav-logo">
          <Link to="/Current_Weather">Current_Weather</Link>
        </span>
      </div>
      <div className="nav-item">
        <Link to="/Forecast">5 days Forecast</Link>
      </div>
      <div className="nav-item">
        <Link to="/UV_info">UV info</Link>
      </div>
    </div>
    </Router>
  );
}

export default Header;
